            // </nav>
        // </div>

        <div className = "ml-2 bg-white">
            <div className = "bg-dark">
                <nav 
                    className = "navbar navbar-warning"
                >
                    <nav 
                        className = "navbar navbar-expand-lg navbar-light bg-dark"
                    >
                    <a 
                        className = "navbar-brand text-light" 
                        style = {{fontSize: "30px"}} 
                        onClick = { () => setComponentName("about") }
                    >About Me</a>
                    <button 
                        className = "navbar-toggler" 
                        type = "button" 
                        data-toggle = "collapse" 
                        data-target = "#navbarNav" 
                        aria-controls = "navbarNav" 
                        aria-expanded = "false" 
                        aria-label = "Toggle navigation"  
                    >
                        <span 
                            className = "navbar-toggler-icon"
                        ></span>
                    </button>
                    <div 
                        className = "collapse navbar-collapse" 
                        id = "navbarNav"
                    >
                        <ul className = "navbar-nav">
                        <li className = "nav-item active">
                            <a 
                                className = "nav-link text-light mt-1" 
                                style = {{fontSize: "28px"}} 
                                onClick = { () => setComponentName("contact") } 
                            >Contact <span className="sr-only">(current)</span></a>
                        </li>
                        <li className = "nav-item">
                            <a 
                                className = "nav-link text-light mt-1" 
                                style = {{fontSize: "28px"}} 
                                onClick = { () => setComponentName("stack") }  
                            >Stack</a>
                        </li>
                        <li className = "nav-item">
                            <a 
                                className = "nav-link text-light mt-2" 
                                style = {{fontSize: "25px"}} 
                                onClick = { () => setComponentName("pricing") }  
                            >Pricing</a>
                        </li>
                        </ul>
                    </div>
                    </nav>

                    <div className = "nav">
                        <Socialnet/>
                    </div>
                </nav>
            </div>


        </div>
     );
}

export default Navbar;
